export const styles = theme => ({
    root: {
        borderRadius: 0,
        maxWidth: "360px",
        padding: theme.spacing(2),
    },
    link: {
        alignItems: "center",
        color: theme.palette.text.primary,
        display: "flex",
        justifyContent: "space-between",
        textDecoration: "none",
    },
    text: { width: "220px" },
});
